import ReactDom from "react-dom";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";


export default function Dashboard() {
    return (

            <Fragment>
                <div className="row">
                    <div className="col-6 homepage-tile vertically-middle light-grey-border">
                        <Link to="/manage-medicine"><h2>Manage Medicine</h2></Link>
                    </div>
                    <div className="col-6 homepage-tile vertically-middle light-grey-border">
                        <Link to="/medicine-history"><h2>View Medicine Records</h2></Link>
                    </div>                    
                    
                </div>
            </Fragment>

        

            
            

    )
}
